import React from "react";
import Button from "./button";
import Text from "./texts";

export default function Footer(){
    return (
        <footer className="flex px-[10%] py-[15px] items-center bg">
            <h1 className="text-[24px] bg-[white]">
                <span className="font-bold text-[red]">RADIO</span>
                <span className="font-bold">VAULTS</span>
            </h1>
        </footer>
    )
}
